description:
En FBI-agent har fatt i uppdrag att transportera ett vittne fran Hawaii till
Los Angeles med ett vanligt passagerarflygplan. Ombord pa planet finns
ocksa en torped som fatt i uppdrag att tysta vittnet och hans bagage,
en bur med giftiga ormar. For att forgora vittnet slapps ormatna fria
omboed pa planet...
Med: Samuel L. Jacksson, Julianna Margulies, Nathan Philips m..fl.

